interface ProjectDashboardProps {
    scale: number
    setScale: (scale: number) => void
}

export default function ProjectDashboard(props: ProjectDashboardProps): React.JSX.Element {
    const { scale, setScale } = props;
    const { services, setStatusBarItem, removeStatusBarItem } = useContext(EditorsContext) as EditorsContextType;
    const archerRef = useRef<ArcherContainerHandle>(null);
    const [sidebarOpen, setSidebarOpen] = useState<boolean>(true);
    const [currentStage, setCurrentStage] = useState<string>('');
    const [previewMode, setPreviewMode] = useState<boolean>(false);
    const [gameConfig, setGameConfig] = useState<GameConfig>();
    const [dragContainerHeight, setDragContainerHeight] = useState<number>(0);
    const [dragContainerWidth, setDragContainerWidth] = useState<number>(0);

    const onWheel = (e: React.WheelEvent): void => {
        if (e.ctrlKey || e.metaKey) {
            let z = scale - e.deltaY / WHEEL_SENSITIVITY;

            if (z > ZOOM_MAX) {
                z = ZOOM_MAX;
            } else if (z < ZOOM_MIN) {
                z = ZOOM_MIN;
            }

            setScale(z);
        }
    };

    const addStage = async () => {
        const dialog = new ConfirmDialog({
            title: 'Activate Preview',
            msg: 'Sorry, a stage editor has not yet been implemented. \n\
                You will need to manually create stages for now, consult the documentation for help. \n\
                Do you want to enable a preview of the dashboard with mocked data?'
        });
        const confirmed = await dialog.open();
        if (confirmed) {
            setPreviewMode(true);
        }
    };

    const getDashboardConfig = async () => {
        const gc = await services.vesProjectService.getGameConfig();
        setGameConfig({
            ...gc,
            _fileUri: undefined,
            _contributor: undefined,
            _contributorUri: undefined,
        } as GameConfig);
    };

    const updateGameConfig = async (partialGameConfig: Partial<GameConfig>) => {
        services.vesProjectService.setGameConfig(partialGameConfig);
        setGameConfig(prev => ({
            ...prev as GameConfig,
            ...partialGameConfig,
        }));
    };

    const determineDragContainerDimensions = () => {
        let height = 0;
        let width = 0;

        Object.values(MOCK_STAGES).forEach(s => {
            const position = gameConfig?.dashboard?.positions && gameConfig?.dashboard?.positions[s._id]
                ? gameConfig?.dashboard?.positions[s._id]
                // : { x: 0, y: 0 };
                : MOCK_POSITIONS[s._id] ?? { x: 0, y: 0 };
            const stageMaxX = s.width + position.x;
            const stageMaxY = s.height + position.y;
            if (stageMaxX > width) {
                width = stageMaxX;
            }
            if (stageMaxY > height) {
                height = stageMaxY;
            }
        });

        const outerPadding = 32 * 2;
        setDragContainerHeight(height + outerPadding);
        setDragContainerWidth(width + outerPadding);
    };

    const getArrowStrokeWidth = (): number => {
        if (scale < 0.5) {
            return 0.5;
        } else if (scale < 1) {
            return 1;
        } else if (scale > 2) {
            return 3;
        }

        return 2;
    };

    const setStatusBarItems = () => {
        setStatusBarItem('ves-dashboard-zoom-out', {
            alignment: StatusBarAlignment.RIGHT,
            priority: 9,
            text: '$(codicon-zoom-out)',
            command: VesProjectCommands.ZOOM_OUT.id,
            tooltip: VesProjectCommands.ZOOM_OUT.label,
            className: scale <= ZOOM_MIN ? 'disabled' : undefined,
        });
        setStatusBarItem('ves-dashboard-zoom', {
            alignment: StatusBarAlignment.RIGHT,
            priority: 8,
            text: `${Math.round(scale * 100)}%`,
            command: VesProjectCommands.ZOOM_RESET.id,
            tooltip: VesProjectCommands.ZOOM_RESET.label,
        });
        setStatusBarItem('ves-dashboard-zoom-in', {
            alignment: StatusBarAlignment.RIGHT,
            priority: 7,
            text: '$(codicon-zoom-in)',
            command: VesProjectCommands.ZOOM_IN.id,
            tooltip: VesProjectCommands.ZOOM_IN.label,
            className: scale >= ZOOM_MAX ? 'disabled' : undefined,
        });
    };

    const removeStatusBarItems = () => {
        removeStatusBarItem('ves-dashboard-zoom-in');
        removeStatusBarItem('ves-dashboard-zoom-out');
        removeStatusBarItem('ves-dashboard-zoom');
    };

    useEffect(() => {
        if (previewMode && Object.keys(MOCK_STAGES).length > 0) {
            setStatusBarItems();
        }
        return () => {
            removeStatusBarItems();
        };
    }, [
        previewMode,
        scale,
        MOCK_STAGES,
    ]);

    useEffect(() => {
        getDashboardConfig();
    }, []);

    useEffect(() => {
        determineDragContainerDimensions();
    }, [gameConfig]);

    return (
        <>
            {gameConfig &&
                <DashboardContainer
                    onWheel={onWheel}
                >
                    {previewMode && Object.keys(MOCK_STAGES).length > 0
                        ? <ArcherContainer
                            ref={archerRef}
                            lineStyle="straight"
                            offset={-8}
                            strokeColor="var(--theia-editor-foreground)"
                            strokeWidth={getArrowStrokeWidth()}
                        >
                            <div
                                style={{
                                    backgroundImage:
                                        `radial-gradient(rgba(0, 0, 0, .${services.themeService.getCurrentTheme().type === 'light' ? 1 : 5}) ${scale}px, transparent 0)`,
                                    backgroundPosition: `${8 * scale}px ${8 * scale}px`,
                                    backgroundSize: `${16 * scale}px ${16 * scale}px`,
                                    height: dragContainerHeight * scale,
                                    minHeight: '100%',
                                    minWidth: '100%',
                                    width: dragContainerWidth * scale,
                                }}
                                onClick={() => setCurrentStage('')}
                            >
                                {Object.values(MOCK_STAGES).map(s => (
                                    <StagePreview
                                        key={s._id}
                                        id={s._id}
                                        archerRef={archerRef}
                                        stage={MOCK_STAGES[s._id]}
                                        positions={gameConfig.dashboard?.positions ?? MOCK_POSITIONS}
                                        setPosition={(p: ControlPosition) => {
                                            const partialGameConfig = {
                                                dashboard: {
                                                    ...(gameConfig.dashboard ?? {}),
                                                    positions: {
                                                        ...(gameConfig.dashboard?.positions ?? MOCK_POSITIONS),
                                                        [s._id]: p,
                                                    }
                                                }
                                            };

                                            const newGameConfig = { ...gameConfig, ...partialGameConfig };
                                            if (JSON.stringify(newGameConfig) !== JSON.stringify(gameConfig)) {
                                                setGameConfig({ ...gameConfig, ...partialGameConfig });
                                                services.vesProjectService.setGameConfig(partialGameConfig);
                                            }
                                        }}
                                        current={s._id === currentStage}
                                        scale={scale}
                                        onClick={e => {
                                            setCurrentStage(s._id);
                                            console.log('setCurrentStage(s._id)', s._id);
                                            e.stopPropagation();
                                        }}
                                        relations={s.targets.map((t: any) => ({
                                            targetId: t.id,
                                            style: {
                                                strokeDasharray: t.type === 'pause' ? '4,4' : undefined
                                            }
                                        }))}
                                    />
                                ))}
                            </div>
                        </ArcherContainer>
                        : <>
                            <div></div>
                            <EmptyContainer
                                title={nls.localize(
                                    'vuengine/project/projectHasNoStages',
                                    'This project does not yet have any stages',
                                )}
                                description={nls.localize(
                                    'vuengine/project/clickBelowToAddFirstStage',
                                    'Click below to add the first stage',
                                )}
                                onClick={addStage}
                            />
                        </>
                    }
                    {!sidebarOpen &&
                        <ShowSidebarButton
                            style={{
                                opacity: sidebarOpen ? 0 : 1,
                            }}
                            className="theia-button secondary"
                            title={nls.localize('vuengine/project/showSidebar', 'Show Sidebar')}
                            onClick={() => setSidebarOpen(true)}
                        >
                            <i className="codicon codicon-chevron-left" />
                        </ShowSidebarButton>
                    }
                    <Sidebar
                        open={sidebarOpen}
                        side='right'
                        width={320}
                    >
                        <VContainer
                            gap={15}
                            overflow="auto"
                            style={{ padding: 'calc(2 * var(--theia-ui-padding))' }}
                        >
                            <HideSidebarButton
                                className="theia-button secondary"
                                title={nls.localize('vuengine/project/hideSidebar', 'Hide Sidebar')}
                                onClick={() => setSidebarOpen(false)}
                            >
                                <i className="codicon codicon-chevron-right" />
                            </HideSidebarButton>
                            {
                                currentStage === ''
                                    ? <ProjectSettings
                                        gameConfig={gameConfig}
                                        setGameConfig={updateGameConfig}
                                    />
                                    : <StageSettings
                                        stageId={currentStage}
                                        gameConfig={gameConfig}
                                        setGameConfig={updateGameConfig}
                                    />
                            }
                        </VContainer>
                    </Sidebar>
                </DashboardContainer>
            }
        </>
    );
}
